To solve the congruence $27a\equiv 17\pmod{40}$, we multiply both sides by $3$ and simplify: \begin{align*}
3\cdot 27a &\equiv 3\cdot 17 \pmod{40} \\
a &\equiv 51 \pmod{40} \\
a &\equiv 11 \pmod{40}
\end{align*}Each operation in this sequence is reversible, so the solution set is exactly the set of integers congruent to $11\pmod{40}$. The smallest and second-smallest positive solutions are $11$ and $51$. Their sum is $\boxed{62}$.

